#include <stdio.h>

int minOperations(int* nums1, int nums1Size, int* nums2, int nums2Size) {
    int max1 = nums1[0], max2 = nums2[0];
    for (int i = 1; i < nums1Size; ++i) {
        if (nums1[i] > max1) max1 = nums1[i];
        if (nums2[i] > max2) max2 = nums2[i];
    }

    int swapCount = 0;
    for (int i = 0; i < nums1Size; ++i) {
        if (nums1[i] == max1 && nums2[i] == max2) continue;
        if (nums1[i] == max1 || nums2[i] == max2) continue;
        if (nums1[i] < max2 && nums2[i] < max1) {
            swapCount++;
            int temp = nums1[i];
            nums1[i] = nums2[i];
            nums2[i] = temp;
        }
    }

    int newMax1 = nums1[0], newMax2 = nums2[0];
    for (int i = 1; i < nums1Size; ++i) {
        if (nums1[i] > newMax1) newMax1 = nums1[i];
        if (nums2[i] > newMax2) newMax2 = nums2[i];
    }

    if (newMax1 == max1 && newMax2 == max2) return swapCount;
    else return -1;
}
